import React from "react";
import { LabelsProps } from "../data/interfaces";
import { MyUsers } from "../data/users";
import { UserProps } from "../data/interfaces";
import MapDatas from "../helper/users-comp";

const mapDatas = MyUsers.map((data: UserProps, index) =>
    <p key={`el-${index}`}>{data.name}</p>
);


const Homepage = ({loadingMessage, errorMessage} : LabelsProps) => {
    return(
        <>
            <p>This is my homepage</p>
            <p>{loadingMessage}</p>
            <p>{errorMessage}</p>

            <ul>
                {MyUsers.map((data: UserProps, index) =>
                        <MapDatas
                            key={data.index} 
                            name = {data.name} 
                            last_name = {data.last_name}
                            imgDesc = {data.author}
                        />    
                )}
                {MapDatas()}
            </ul>

            {mapDatas}
        </>
    )
}

export default Homepage;
